The intro song added is a parody called &quot;SCHWEEN OF THE TIGER&quot; (to the tune of EYE OF THE TIGER) Written and performed by The Covino and Rich show on Sirius Satellite Radio Channel 108 and XM Channel 139, By their band named &quot;Ticklesack&quot;
